CREATE DEFINER=`root`@`localhost` FUNCTION `gettoken`() RETURNS varchar(200) CHARSET utf8
BEGIN
	declare returntoken VARCHAR(200);
	declare totalcounter integer;
	SELECT MAX(`token`), (`counter` + 1)
	into returntoken, totalcounter
	FROM `tokens` 
	WHERE `counter` = (SELECT MAX(`counter`) FROM `tokens`);
	update `tokens`
	set `counter` = totalcounter
	where `token` = returntoken;
	return returntoken;
END$$

