(1, 'Mountain biking association of B&H ', 'mountain-biking-association-of-bh-', 'Naravno, ne svratismo u kafanu jer nam valja, ohoho, na vrh brda, put je dug a dan kratak. Malo dalje, na samoj Neretvici nalazi se lovaÄki dom. Za razliku od proÅ¡le godine kad je bio prazan, ovaj put zatekosmo svu silu meraklija u zelenim odorama. PuÅ¡ke su odloÅ¾ili i danas ne love. Imaju godiÅ¡nji skup, valjda neka skupÅ¡tina, Å¡ta li? OduÅ¡evljeno nas pozdravljaju, goste toplim Äajem, nude da Å¡ta prezalogajimo, roÅ¡tilj se puÅ¡i a gajbe uredno posloÅ¾ene. ÄŒitaju, kaÅ¾u, naÅ¡e reportaÅ¾e jer se i sami kreÄ‡u istim planinama. Jedan kroz Å¡alu izjavljuje kako i on koristi bicikl. TaÄnije, na â€œDan bez automobilaâ€ ode do posla biciklom. A sumnjiÄavo vrti glavom kad rekosmo kuda idemo.'),
(2, 'Vitreuša isti smjer', 'vitreusa-isti-smjer', 'een the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with d'),
(3, 'Vitreuša isti smjer', 'vitreusa-isti-smjer', 'een the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with d'),
(4, 'Nova vitreusa', 'nova-vitreusa', 'Za razliku od Ministarstva finansija BiH i Parlamentarne skupÅ¡tine BiH koji na transparentan naÄin dostavljaju informacije o primanjima najviÅ¡ih zvaniÄnika, entitetska ministarstva finansija i porezne uprave od bh. javnosti kriju podatke o plaÄ‡ama drÅ¾avnih funkcionera. \n\nNaime, u ovom kontekstu podaci koji se odnose na primanja i naknade nisu zaÅ¡tiÄ‡eni Zakonom o zaÅ¡titi liÄnih podataka te bi iz tog razloga trebali bit dostupni graÄ‘anima. Entitetske institucije mogu zaÅ¡titi odreÄ‘ene dijelove podataka poput adrese stanovanje ili kreditnih zaduÅ¾enja, ali generalno ne bi smjele zbog transparentnosti uskraÄ‡ivati graÄ‘anima pravo da znaju koga to plaÄ‡aju. \n'),
(5, 'Busovacke staje', 'busovacke-staje', 'Busovačke staje su od Busovače udaljene 15 kilometara, a Pridolci 12. Ceste nisu asfaltirane i prema iskustvu jednog od naših čitalaca sa sobom je dobro imati lance, mada će i dobre zimske gume biti sasvim dovoljne.\nNa ulazu u Busovaču iz smjera Sarajeva (stara cesta) skrene se lijevo i prati putokaz za Tisovac i Ravan. Iz smjera Lašve je desno na izlazu iz Busovače.Vozi se oko 3 km asfaltom ravno dok se ne dođe do rampe (koja je podignuta) i kućice šumarije.\nRavno kroz rampu nakon 1 km se nalazi križanje lijevo (na slikama dole) prema Pridolcima (7 km) ili desno na Busovačke staje (10 km).'),
(6, 'Čabulja', '', 'Čabulja je planina u Hercegovini između rijeke Neretve i njene desne pritoke Drežanke. Najviši vrh je Velika Vlajna 1776 m.  Građena je od mezozojskih vanpenaca, a djelomično i od dolomita. Morfotektonski je produžetak planine Velež. Prema dolini Drežanke oštro je oivičena nekoliko stotina metara visokim tektonskim strinama, dok prema jugozapadu prelazi u podgorinu. Snažna pleistocenska glacijacija ostavila je na mnogim mjestima duž obe podgorine planine, a naročito duž jugozapadne velike komplekse morenskih nasipa.  Čabulja je uglavnom gola, krševita i bezvodna, sa malo obradive zemlje u uskim udolinama jugozapadne podgorine, gdje se nalaze malobrojna razbijena seoska naselja. U većem dijelu Čabulja je područje ljetnjih ispaša sa sezonskim stočarskim naseljima, među njima i stočara iz submediteranske zapadne Hercegovine.'),
